import React from "react";

const ToDoList = (props) => {
  return (
    <div>
      <ul>
        {props.todos.map((item, index) => (
          <li className="todo-item" onClick={() => props.onTodoClick(index)}>
            {item.title}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ToDoList;
